// The ./types module provides helper types for your Input events and messages.
import { Input, Message } from "./types";

// Define the global variables type - adjust the properties as needed for your global variables
type GlobalVariables = {
  globalVariable: number; // Replace with your actual global variable name and type
};

// Define the output message type for the helix configuration
type HelixConfigOutput = {
  interface_names: string[];
  values: number[];
};

// Subscribe to any input topic (required even if we don't use it)
// You can use any existing topic in your data source
export const inputs = ["/input/topic"];

// Publish to the helix command configuration topic
export const output = "/helix/command/configuration";

// This function is called with messages from input topics and has access to global variables
export default function script(
  event: Input<"/input/topic">,
  globalVars: GlobalVariables,
): HelixConfigOutput {
  // Get the slider value from global variables
  const sliderValue = globalVars.globalVariable || 0.0;

  // Return the configuration message with the variable second value
  return {
    interface_names: ["segment1_dx", "segment1_dy", "segment1_l"],
    values: [0.0, sliderValue, 0.22],
  };
}

